Each row in JSON data can be encoded using array for size reduction. This convention allows us to avoid repeating column names in every row. For example: [ {"col1": 1, "col2": "abc"}, {"col1": 2, "col2": "efg"}
] Can be stored as: [ [1, "abc"], [2, "efg"]
] When loading JSON rows using array encoding, one needs to explicily specify the schema since there is no column name in the datasource anymore for ROAPI to perform the schema inference: tables: - name: "mytable" uri: "http://mytable.json" option: format: "json" array_encoded: true schema: columns: - name: "col1" data_type: "Int64" - name: "col2" data_type: "Utf8" Found a bug? Edit this file on GitHub.

