Query tables using SQL, GraphQL or REST: curl -X POST -d "SELECT city, lat, lng FROM uk_cities LIMIT 2" localhost:8080/api/sql
curl -X POST -d "query { uk_cities(limit: 2) {city, lat, lng} }" localhost:8080/api/graphql
curl "localhost:8080/api/tables/uk_cities?columns=city,lat,lng&limit=2" Sample response: [ { "city": "Elgin, Scotland, the UK", "lat": 57.653484, "lng": -3.335724 }, { "city": "Stoke-on-Trent, Staffordshire, the UK", "lat": 53.002666, "lng": -2.179404 }
] See Query frontends for details on different operators supported by each frontend.
